fragment:
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:geothermal_power_plant rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :geothermal ;
            owl:onProperty :has_energy_source ],
        :power_plant .

